Application.ScrollMagic.Scenes.Experience=function(){const TIMELINE=(new TimelineMax).fromTo("[data-target='greatExperienceTitle']",2,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0});for(const[index,element]of Object.entries(document.querySelectorAll('[data-target="greatExperienceProgressBar"]'))){const PERCENT=$(element).attr("data-progress"),BAR=element.querySelector('[data-target="bar"]'),TEXT=element.querySelector('[data-target="text"]');TIMELINE.fromTo(BAR,3,{opacity:0,width:0},{opacity:1,width:`${PERCENT}%`},(index+1)/3).fromTo(TEXT,5,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0},(index+1)/3)}for(const[index,element]of Object.entries(document.querySelectorAll('[data-target="greatExperienceCard"]')))TIMELINE.fromTo(element,3,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0});return TIMELINE.fromTo('[data-target="greatExperienceYearsExperience"]',5,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0},2),TIMELINE.fromTo('[data-target="greatExperienceDownloadCV"]',2,{opacity:0,y:10,rotationY:10},{opacity:1,y:0,rotationY:0}),Application.Layout.set("Experience",new ScrollMagic.Scene({triggerElement:"#great-experience",triggerHook:.75,duration:"100%"}).setTween(TIMELINE).addTo(Application.ScrollMagic.Controllers.Main)),!0};